import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, useNavigate } from 'react-router-dom';
import './App.css';
import AddCar from './AddCar';
import EditCar from './EditCar';
import Home from './Home'; // Certifique-se de ter esse componente

function App() {
    const [data, setData] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = () => {
        fetch('http://localhost:25000/data')
            .then(response => response.json())
            .then(data => setData(data))
            .catch(error => console.error("Erro ao buscar os dados:", error));
    };

    const handleDelete = (id) => {
        fetch(`http://localhost:25000/data/${id}`, {
            method: 'DELETE',
        })
        .then(() => fetchData()) // Atualiza a lista após deletar
        .catch(error => console.error("Erro ao deletar o carro:", error));
    };

    return (
        <div className="App">
            <h1>Car List</h1>
            <Link to="/add-car"><button>Incluir Carro</button></Link>
            <table>
                <thead>
                    <tr>
                        <th>Modelo</th>
                        <th>Marca</th>
                        <th>Ano</th>
                        <th>Categoria</th>
                        <th>Disponibilidade</th>
                        <th>Ações</th>
                    </tr>
                </thead>
                <tbody>
                    {Array.isArray(data) && data.map(car => (
                        <tr key={car.id}>
                            <td>{car.modelo}</td>
                            <td>{car.marca}</td>
                            <td>{car.ano}</td>
                            <td>{car.categoria}</td>
                            <td>{car.disponibilidade ? 'Disponível' : 'Indisponível'}</td>
                            <td>
                                <Link to={`/edit-car/${car.id}`}>
                                    <button>Editar</button>
                                </Link>
                                <button onClick={() => handleDelete(car.id)}>Excluir</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

function AppWrapper() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/edit-car/:id" element={<EditCar />} />
                <Route path="/add-car" element={<AddCar />} />
                <Route path="/car-list" element={<App />} /> {/* Adicionei uma rota para a lista de carros */}
            </Routes>
        </Router>
    );
}

export default AppWrapper;
